INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "春咲 ひより", 0, 1, "お！\nあそこに困ってそうな人発見！", 0, 2, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "草野 優衣", 0, 1, "大切な人を\n守れるようになりたい…って", 0, 2, "みんなみたいに\nわたしも強くならなきゃ", 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "士条 怜", 0, 1, "キミに必要な集中力と感性が", 0, 2, "フェンシングを始めてみては？", 0, "少しは磨かれると思いますよ。", 1003, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "穂高 みそぎ", 0, 1, "今日はなにして遊ぶ？", 0, 2, "ねぇ、にいちゃん！", 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1004, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "風宮 あかり", 0, 1, "ねぇ…", 0, 2, "風宮あかりです", 0, "私といっしょに…\nいかない？", 1006, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "出雲 宮子", 0, 1, "プリンたべたいのー", 0, 2, "出雲宮子なのー", 0, "食べ物の恨みは怖いのー", 1007, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "虹村 雪", 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 2, "ボクは虹村雪。", 0, "いいよ。\n見られることは運命さ…", 1008, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "柊杏奈", 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 2, "フッ…聞いて後悔するがいい！", 0, "人呼んで「疾風の冥姫」!!", 1009, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "姫宮 真歩", 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 2, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "ほんまおおきにやわ～♪", 1010, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "衣之咲 璃乃", 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 2, "衣之咲璃乃です！", 0, "ここで会ったが\n100年目～！", 1011, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "柏崎 初音", 0, 1, "ち、超能力って…\n何のことかな～？", 0, 2, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "…って、お願い！\n誰にも言わないでおいて～！", 1012, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "美波 鈴奈", 0, 1, "一応カリスマ読モJKやってまっす！", 0, 2, "ちょす！\n美波鈴奈だよ～♪", 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "喜屋武 香織", 0, 1, "東京は遊園地みたいなところさー", 0, 2, "はいたーい。\n喜屋武香織さー。", 0, "でも、沖縄もとってもいいとこさー", 1017, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "支倉 伊緒", 0, 1, "先生って呼ばれるのは\nくすぐったいから", 0, 2, "支倉伊緒です。", 0, "イオちゃんって呼んでね。", 1018, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "茜 ミミ", 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 2, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "ミミをおいてかないでぇ～", 1020, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "栗林 くるみ", 0, 1, "あの……\nふぇ……", 0, 2, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "ふぇぇぇぇぇん……", 1021, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "風宮 より", 0, 1, "こんな私に貴重な時間を\n割いていただき、", 0, 2, "風宮よりです。\nあああああ！", 0, "なんてありがとうございます！", 1022, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "北条 綾音", 0, 1, "おにいちゃんどこいくの？\nえ？", 0, 2, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "私こっち行きたいー\nね、早く早くー", 1023, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "天野 すずめ", 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 2, "わっ…わっ…私、\n天野すずめといいます！", 0, "これて何か違う…\nあああすみません！", 1025, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "倉石 恵理子", 0, 1, "あなたは…運命の……\n伴侶……", 0, 2, "……クスクス…私は\n…倉石恵理子……", 0, "離しませんわ………\n絶対に…!!", 1027, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "佐々木 咲恋", 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 2, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "…そうでしょ？？", 1028, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "桜井 望", 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", 0, 2, "桜井望だよ！\nよろしくねっ", 0, "あはは、\n私もまだまだだなぁ～", 1029, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "ニノン・ジュベール", 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 2, "デケデケデンっ！", 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1030, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "上喜 しのぶ", 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", 0, 2, "上喜しのぶです。\n手元のドクロが父です。", 0, "おかしいですね……", 1031, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "野戸まひる", 0, 1, "けんども\nそれには足りないモンが…", 0, 2, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "そう、\nオラのボケに突っ込める相方が…！", 1033, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "綾瀬 ゆかり", 0, 1, "ちょっと緊張しちゃって…", 0, 2, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "ちょ\nちょっと一杯飲んできます…！", 1034, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "氷川 鏡華", 0, 1, "知らない人とは話しちゃいけないので", 0, 2, "氷川鏡華…です", 0, "これ以上お話しすることは…\nないです！", 1036, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "柏崎 栞", 0, 1, "……あ、アラーム。", 0, 2, "柏崎…栞です。", 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "双葉 碧", 0, 1, "私、一人も友達がいなくて……", 0, 2, "ふ、双葉碧です。", 0, "野に咲く花が、\n唯一の話相手です。", 1040, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "三角 千歌", 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 2, "三角千歌です。", 0, "そう思っています。", 1042, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "安芸 真琴", 0, 1, "あぁ？\nお前のそいつの仲間か？", 0, 2, "安芸真琴だ。", 0, "う、疑ってすまなかったな…", 1043, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "イリヤ・オーンスタイン", 0, 1, "生けとし生ける全ての者よ！", 0, 2, "わらわこそは夜を総べる者！", 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "遠見 空花", 0, 1, "ぐふふふふ……はっ！", 0, 2, "そこで騎士は妖精を乱暴に……", 0, "ｌク、クウカに何かご用ですか!?", 1045, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "宮坂たまき", 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 2, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1046, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "大神 美冬", 0, 1, "それでは早速クエストに…", 0, 2, "大神美冬よ！", 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "星野静流", 0, 1, "クエストもバトルも\n掃除も洗濯も", 0, 2, "星野静流だよ！", 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "玉泉美咲", 0, 1, "見ての通りの\nセクシー美少女で", 0, 2, "アタシは玉泉美咲。", 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.4, 0, "リマ", 0, 1, "？？？？", 0, 2, "？？？", 0, "？？？？", 1052, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "モニカ・ヴァイスヴィント", 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 2, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる", 1053, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "ペコリーヌ", 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 2, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる", 1058, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "コッコロ", 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 2, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる", 1059, 0);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 1.5, 0, "キャル", 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 2, "モニカ・ヴァイスヴィントだ。", 0, "そ、そこまでいうなら\nもらってやる", 1060, 0);
